import{_ as i,c as o,o as t,a4 as a}from"./chunks/framework.uQk9_EO2.js";const n="/docs/cocos/assets/project.BeTAe040.png",r="/docs/cocos/assets/cc-build-menu.BDHu90YZ.png",s="/docs/cocos/assets/new-build-task.CHOdkRpj.png",d="/docs/cocos/assets/select-platform.BpY9ctA7.png",l="/docs/cocos/assets/start-scene.BendNmNC.png",p="/docs/cocos/assets/game-package-name.ClGXU0p8.png",c="/docs/cocos/assets/target-api-level.B0jUDL27.png",u="/docs/cocos/assets/build.BxDLPR3F.png",g="/docs/cocos/assets/building.Cg451itJ.png",h="/docs/cocos/assets/open.CGON8Pq1.png",A="/docs/cocos/assets/find-proj.6s93KK5p.png",m="/docs/cocos/assets/as-open-menu.DmP_yn5g.png",b="/docs/cocos/assets/as-open-proj.BRonVtVF.png",f="data:image/png;base64,",y="data:image/png;base64,",k="/docs/cocos/assets/build-apk.BYzmI62c.png",C="/docs/cocos/assets/apk.DWEMU9i-.png",e="/docs/cocos/assets/gen-sign-apk.C3FWSjwe.png",I="/docs/cocos/assets/create-sign.Dxdmm4fw.png",v="/docs/cocos/assets/android-keystore-panel.DGxWQ13D.png",P="/docs/cocos/assets/debug-keystore.Bb6KqSlW.png",B="/docs/cocos/assets/show-log.DwYSRN9F.png",Y=JSON.parse('{"title":"Android Publish Example","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/publish/android/build-example-android.md","filePath":"en/editor/publish/android/build-example-android.md","lastUpdated":1712305443000}'),q={name:"en/editor/publish/android/build-example-android.md"},K=a('<h1 id="android-publish-example" tabindex="-1">Android Publish Example <a class="header-anchor" href="#android-publish-example" aria-label="Permalink to &quot;Android Publish Example&quot;">​</a></h1><p>In this section, we will introduce how to build Cocos Creator project with Android Studio.</p><p>Please prepare a Cocos Creator project with at least one scene.</p><p><img src="'+n+'" alt="project.png"></p><h2 id="set-android-development-environment" tabindex="-1">Set Android Development Environment <a class="header-anchor" href="#set-android-development-environment" aria-label="Permalink to &quot;Set Android Development Environment&quot;">​</a></h2><p>To publish an Android native application, you need to install the Android Studio development environment, as well as specific versions of JDK (or OpenSDK), Android SDK, NDK, and more. For more details, please refer to the <a href="./build-setup-evn-android">Android Native Development Environment Setup</a>.</p><h2 id="publish-process" tabindex="-1">Publish Process <a class="header-anchor" href="#publish-process" aria-label="Permalink to &quot;Publish Process&quot;">​</a></h2><p>The next step is to create a new build task and publish an Android APK on the <strong>Build</strong> panel in Cocos Creator.</p><h3 id="create-build-task" tabindex="-1">Create Build Task <a class="header-anchor" href="#create-build-task" aria-label="Permalink to &quot;Create Build Task&quot;">​</a></h3><ol><li><p>By clicking the <strong>Project</strong> -&gt; <strong>Build</strong> menu to open <strong>Build</strong> panel.</p><p><img src="'+r+'" alt="cc-build-menu.png"></p></li><li><p>At the top of <strong>Build</strong> panel, click on the <strong>New Build Task</strong> button</p><p><img src="'+s+'" alt="new-build-task.png">P</p></li><li><p>To select <strong>Android</strong> as the build target platform, click on the drop-down menu</p><p><img src="'+d+'" alt="select-platform.png"></p></li><li><p>Make sure to have at least one scene designated as the Start Scene. If you have only one scene, it will be added by default</p><p><img src="'+l+`" alt="start-scene.png"></p></li><li><p>Please refer to <a href="./../native-options#Render BackEnd">Publishing to Native Platforms - Render BackEnd</a> to select an appropriate render backend</p><pre><code> ![render-backend.png](images/render-backend.png)
</code></pre></li><li><p>Enter the Game Package Name</p><p><img src="`+p+'" alt="game-package-name.png"></p><blockquote><p>Please refer to <a href="./../native-options#Bundle Identifier">Bundle Identifier</a> for guidance your app&#39;s bundle identifier</p></blockquote></li><li><p>Select Target API Level</p><p><img src="'+c+'" alt="target-api-level.png"></p><blockquote><p>In case no dropdown content, please check the SDK and NDK configuration in Cocos Creator</p></blockquote></li></ol><p>Other build options please refer to <a href="./../native-options">Publishing to Native Platforms</a></p><h3 id="build-and-publish" tabindex="-1">Build and Publish <a class="header-anchor" href="#build-and-publish" aria-label="Permalink to &quot;Build and Publish&quot;">​</a></h3><ol><li><p>To begin a build process, click on the <strong>Build</strong> button for the selected build task.</p><p><img src="'+u+'" alt="build.png"></p></li><li><p>Please wait until the build process finished</p><p><img src="'+g+'" alt="building.png"></p></li><li><p>Click on the button below to open the folder containing the exported Android Project</p><p><img src="'+h+'" alt="open"></p></li><li><p>Locate the corresponding directory</p><p><img src="'+A+'" alt="find-proj"></p></li><li><p>Click on the open menu on android studio</p><p><img src="'+m+'" alt="android studio open project menu"></p></li><li><p>Navigate to the project path in the <code>{Your project}/build</code> directory, which is named &#39;android&#39; by default, and open it using Android Studio.</p><p><img src="'+b+'" alt="android studio open project"></p></li><li><p>Generate APK in Android Studio</p><p>After the preparation has been completed by Android Studio, you can start building an Android APK. However, the sync process may take a long time to complete. If this happens, you can stop any ongoing background tasks by following the steps below:</p><p>Click on the background task on the status bar: <img src="'+f+'" alt="background-task.png"> <br></p><p>Close all background tasks by clicking on the close button <img src="'+y+'" alt="interrupt-sync.png"></p></li><li><p>Click on <strong>Build Bundle(s) / APK(s)</strong> in the <strong>Build</strong> menu</p><p><img src="'+k+'" alt="build-apk.png"></p></li><li><p>The debug APK could be found in the <code>{proj/build}</code> directory</p><p><img src="'+C+'" alt="apk.png"></p></li></ol><h2 id="keystore-generation-and-usage" tabindex="-1">Keystore Generation and Usage <a class="header-anchor" href="#keystore-generation-and-usage" aria-label="Permalink to &quot;Keystore Generation and Usage&quot;">​</a></h2><p>For the release of the final version, the debug key cannot be used. You need to create your own key.</p><h3 id="creating-a-key" tabindex="-1">Creating a Key <a class="header-anchor" href="#creating-a-key" aria-label="Permalink to &quot;Creating a Key&quot;">​</a></h3><p>You can generate a key using Android Studio:</p><ol><li><p>In Android Studio, click on the &quot;Build&quot; menu and select &quot;Generate Signed Bundle / APK&quot;: <img src="'+e+'" alt="gen-sign-apk.png"></p></li><li><p>In the pop-up window, select &quot;APK&quot; and click &quot;Next&quot;: <img src="'+e+'" alt="gen-sign-apk.png"></p></li><li><p>In the guided window, click on &quot;Create new&quot;: <img src="'+I+'" alt="create-sign.png"></p></li><li><p>Fill in the required information in the pop-up window: <img src="'+v+'" alt="android-keystore-panel.png"></p></li></ol><blockquote><p>It is recommended to use different keys for different projects. You can store each project&#39;s key in the project&#39;s root directory.</p></blockquote><h3 id="using-the-key" tabindex="-1">Using the Key <a class="header-anchor" href="#using-the-key" aria-label="Permalink to &quot;Using the Key&quot;">​</a></h3><p>After successfully creating the key, a key file will be generated in the selected directory. You can fill in the key information in the Android build panel. This way, both the debug and release versions will use the key you created.</p><p>As shown in the following image, uncheck the &quot;Use debug keystore&quot; option and select your custom key file from the &quot;Keystore Path&quot; below. Fill in the relevant information: <img src="'+P+'" alt="debug-keystore.png"></p><h3 id="considerations" tabindex="-1">Considerations <a class="header-anchor" href="#considerations" aria-label="Permalink to &quot;Considerations&quot;">​</a></h3><ol><li>It is recommended to create a dedicated key for each project from the first release.</li><li>Some SDK services require APK key signature verification. Using the default debug key may result in service call failures.</li></ol><h2 id="advanced" tabindex="-1">Advanced <a class="header-anchor" href="#advanced" aria-label="Permalink to &quot;Advanced&quot;">​</a></h2><h3 id="java-and-typescript-communication" tabindex="-1">Java and TypeScript Communication <a class="header-anchor" href="#java-and-typescript-communication" aria-label="Permalink to &quot;Java and TypeScript Communication&quot;">​</a></h3><p>The engine provides various methods to solve the communication issues between TypeScript and the native layer.</p><p>When integrating common SDKs, we often need to perform login operations through the SDK&#39;s login interface, and then pass the results to the TypeScript layer for further processing in the game.</p><p>The engine provides three methods for communication between TypeScript and Android native layer.</p><ul><li><p><a href="./../../../advanced-topics/js-java-bridge">JavaScript and Java Communication using JsbBridge</a>: This method is very convenient for integrating SDKs and handling actions such as registration, login, and displaying ads. It can quickly solve these types of problems.</p></li><li><p><a href="./../../../advanced-topics/JSB2.0-learning">Tutorial: JSB 2.0</a>: This method is recommended for frequent C++ API calls or batch exporting of C++ APIs..</p></li><li><p><a href="./../../../advanced-topics/java-reflection">JavaScript and Android Communication with Reflection</a>: This method is highly effective for non-frequent calls.</p></li></ul><h3 id="importing-third-party-libraries" tabindex="-1">Importing Third-Party Libraries <a class="header-anchor" href="#importing-third-party-libraries" aria-label="Permalink to &quot;Importing Third-Party Libraries&quot;">​</a></h3><p>To publish your application to the app market, you usually need to integrate certain third-party SDKs. These SDKs are typically provided in JAR or AAR format. You can refer to <a href="https://developer.android.com/studio/projects/android-library?hl=zh-cn#psd-add-library-dependency" target="_blank" rel="noreferrer">Using Your Library in Other Projects</a> to import the local library into your project.</p><h3 id="extending-build-process" tabindex="-1">Extending Build Process <a class="header-anchor" href="#extending-build-process" aria-label="Permalink to &quot;Extending Build Process&quot;">​</a></h3><p>Please refer to <a href="./../custom-build-plugin">Extending Build Process</a> to extend the publishing mechanism by the extension system.</p><h2 id="q-a" tabindex="-1">Q&amp;A <a class="header-anchor" href="#q-a" aria-label="Permalink to &quot;Q&amp;A&quot;">​</a></h2><ul><li><p>Q： How to debug publishing errors</p><ul><li><p>A： You can debug publishing errors by opening the log.txt file using the log button</p><p><img src="'+B+'" alt="show-log.png"></p></li></ul></li><li><p>Q： Missing LIB_EGL</p><ul><li>A： Change your NDK to the version mentioned above.</li></ul></li><li><p>Q： Asset name mechanism</p><ul><li>A： Since Android is based on Linux, some file specifications of Linux still apply in Android, such as <ul><li><ol><li>Android is case-sensitive, make sure the path is case-sensitive, otherwise, it will not load correctly</li></ol></li><li><ol start="2"><li>Do not include spaces in the folder or file name</li></ol></li></ul></li></ul></li></ul>',36),S=[K];function w(x,j,F,T,R,X){return t(),o("div",null,S)}const E=i(q,[["render",w]]);export{Y as __pageData,E as default};
